    {
      "date": "1762-01-17",
      "tags_section": "Ein Audin-Kansterlein",
      "text": "2. Ein Audin-Kansterlein; Item ein Schleifstein mit einem Stede in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1762-01-17",
      "tags_section": "Es fungirt: Meynern an der Guthgafs fuh freyd angeangelte viele Dichtigs in billigem Preis zu haben."
      ,
      "text": "3. Es fungirt: Meynern an der Guthgafs fuh freyd angeangelte viele Dichtigs in billigem Preis zu haben."
    },
    {
      "date": "1762-01-17",
      "tags_section": "Ein Baifloß sur Blumen",
      "text": "4. Ein Baifloß sur Blumen if getuter alter Honig die Nauch à 12 Pfg. Item Endt à 12 Pfg. der Tenner. Einige lobliche gute Bedden in billigem Preis zu haben."
    },
    {
      "date": "1762-01-17",
      "tags_section": "Es werden lobliche, weisse und schöne Canarien-Vogelbäume Widmü und Weißl. in billigem Preis zu haben, wenn im Berichthaus zu vernehmen."
      ,
      "text": "5. Es werden lobliche, weisse und schöne Canarien-Vogelbäume Widmü und Weißl. in billigem Preis zu haben, wenn im Berichthaus zu vernehmen."
    },
    {
      "date": "1762-01-17",
      "tags_section": "Mehr Saum gutter rother alter Landwein à 10 Pfund der Saum. Gote er aber juglich mit einer genommmen werden zu 9 Brand, mehr man das Stüfflein gen au einmal laren möbte.",
      "text": "6. Mehr Saum gutter rother alter Landwein à 10 Pfund der Saum. Gote er aber juglich mit einer genommmen werden zu 9 Brand, mehr man das Stüfflein gen au einmal laren möbte. Er were lauslich für einen Geburt in der Stadt oder auf der Landfahrt, wovon Matter zu haben den Herrn, Franz Vucas in der kleinen Stadt, leydet aber nicht lang Berüg."
    },
    {
      "date": "1762-01-17",
      "tags_section": "Ein Haupt-Einbürgertum in Sein Baif",
      "text": "7. Ein Haupt-Einbürgertum in Sein Baif und ungeriebe 3 Saum tober Ermagder-Bein von 1753, davon man Dynnemen haben kann, folge er abbe mit einem genommmen werden, fo wurde man für billigen Preis nachdenken."
    },
    {
      "date": "1762-01-17",
      "tags_section": "Ein Etod istbones fremdrediges unterbegenet",
      "text": "8. Ein Etod istbones fremdrediges unterbegenet, Embd gleich vor dem Nichemmer-Torb, und ift ich Barum bey Herrn, Apotheker's Math. Rohbiner auf dem Weiher auszumelden."
    },
    {
      "date": "1762-01-17",
      "tags_section": "Eine Befestigung mit einer Feuer und schönen Gebaude",
      "text": "9. Eine Befestigung mit einer Feuer und schönen Gebaude, die 8 Tag get und Biected expektirt in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1762-01-17",
      "tags_section": "Sehen Caum weiser Margreßer Bower-Wein von 1753",
      "text": "10. Sehen Caum weiser Margreßer Bower-Wein von 1753, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1762-01-17",
      "tags_section": "Eine fehne mühsame Herbloben für 2 Personen",
      "text": "11. Eine fehne mühsame Herbloben für 2 Personen, mit Schrauben, Item eine Caffe von Bufem elcientem Dots, fober angreifchen mit einer extra guten Caffel und Caffelen, und einem Haafsloch mit einer Changen, und Dazel inovolig mit Haaden auf einen getrenen Fig, à 6 Pfund. Ein Genwicht-Brate famt 2 Pfund, Getl, Getranken, Stein und Zuckerbröt: Item eine große tuffern Caffedelrolle falt net, dies eine neue Küchlein-Wanne; Zao noch fall neue Rollen, wohl mit harfen Ein verfehen fann eine Kette, Eilt und Ein, albes in billigem Preis, im Berichthaus ohne Entgeidt zu erfragen."
    },
    {
      "date": "1762-01-17",
      "tags_section": "Bee Meißter Daniel Uffter",
      "text": "12. Bee Meißter Daniel Uffter, im Doctor-Gats, ten ihn lobene Kanneleiten-Burger und sucht Gobs-Litien über Narcissus Indicaus Jacobaeus in billigem Preis zu haben."
    },
    {
      "date": "1762-01-17",
      "tags_section": "Ein inbdenfachet tubenete Kleid",
      "text": "13. Ein inbdenfachet tubenete Kleid in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1762-01-17",
      "tags_section": "Bee loben Herbloben eingekammeltes Her",
      "text": "14. Bee loben Herbloben eingekammeltes Her und dito Entdt vom portigen Fabe, in billigem Preis, im Berichthaus zu erfragen."
    },
    {
      "date": "1762-01-17",
      "tags_section": "Bee Folge Bicher zu haben",
      "text": "15. Bee Folge Bicher zu haben, ift im Be- richthaus zu erfragen: Münchener Teomrographer, Brands allgemeine Chronica, Heidens Kirchenbifchrift, Josephi Juditche Gechichte, Sleidani Historien, albes wohl gebunben, im Berichthaus zu erfragen."
    }
  ]
